import React from 'react';

type SkillsProps = {
    skills: string[]
}

const styles = {
    margin: "px"
}

const Skills = (props: SkillsProps) => {
    const { skills } = props;
    return (
        <div role="list">
            {skills.map((skill, index) => {
                return (
                    <span style={styles} key={index} role="listitem">{skill}</span>
                )
            })}
        </div>
    );
};

export default Skills;
